import React from 'react';
import './Logo.scss';

const Logo = () => (
  <div className="logo-wrap">
    <div className="logo-area">
      <h1 className="logo" data-heading="MBTI X MATCH">
        MBTI X MATCH
      </h1>
    </div>
  </div>
);

export default Logo;
